import React from "react";
import { useState, useEffect } from "react";
import info from "./info.png";

export default function News() {
  const [post, setPost] = useState([]);
  const [news, setNew] = useState(
    "https://newsapi.org/v2/everything?q=health&from=2022-05-09&sortBy=publishedAt&apiKey=ed1e115e6a38407e96ac4cf0ff549259"
  );

  function setNews() {}

  useEffect(() => {
    fetch(url).then((response) =>
      response.json().then((data) => setPost(data.articles))
    );
  }, []);

  post.forEach((article) => {
    console.log(article.content);
  });
  return (
    <div className="bbg-[#202124]   h-auto  mt-[100px] max-w-[1400px] mx-auto">
      <div className="flex gap-10">
        <div className="top-list w-[25%] sticky h-[400px]">
          <h1 className="text-3xl  text-gray-400 underline">NEWS</h1>
          <div className="h-full border-[1px] border-gray-600 p-6 rounded-md mt-10">
            ss
          </div>
        </div>
        <div className="news-list max-w-[50%]">
          <div className="hhh bg-[#202124] h-[80px]">
            <h1 className=" text-3xl  text-white underline">NEWS</h1>
            <div className="flex gap-4 my-10 bg-[#202124] justify-between">
              <div
                onclick={setNews}
                className="hover:border-red-400 w-[200px] text-white h-[40px] rounded-md flex items-center justify-center border-[1px] border-gray-500 mb-5"
              >
                COVID-19
              </div>
              <div className="hover:border-red-400 w-[200px] text-white h-[40px] rounded-md flex items-center justify-center border-[1px] border-gray-500 mb-5">
                Health
              </div>

              <div className="hover:border-red-400 w-[200px] text-white h-[40px] rounded-md flex items-center justify-center border-[1px] border-gray-500 mb-5">
                Fitness
              </div>
            </div>
          </div>

          <div className="">
            {post.map((post) => (
              <div className="flex  mt-20 mb-4  ">
                <div className="  border-[1px] border-gray-600 p-6 rounded-md     flex flex-col gap-7 ">
                  <h1 className="text-2xl text-white">{post.title}</h1>
                  <img
                    className="mt-2 max-h-[300px]"
                    src={post.urlToImage}
                    alt=""
                  />
                  <p className="text-white">{post.content}</p>{" "}
                  <a
                    className="underline text-blue-700 text-righttext-blue-600"
                    href={post.url}
                  >
                    View more..
                  </a>
                  <p className="text-right text-gray-400">{post.publishedAt}</p>
                </div>
              </div>
            ))}
          </div>
        </div>

        <div className="top-list w-[35%] sticky h-[700px]  ">
          <h1 className="text-3xl  text-gray-400 underline">NEWS</h1>
          <div>
            <div className="flex rounded-md  bg-yellow-500 flex-col mt-10 p-5">
              <h1 className="font-bold text-black">Health information</h1>
              <div className="flex justify-between ">
                <p className="text-gray-900 mt-4 pr-8">
                  See the latest on coronavirus (COVID-19) prevention, symptoms
                  and treatment from the World Health Organization (WHO) and
                  others
                </p>
                <img className="w-[100px] h-[60px]" src={info} alt="" />
              </div>
              <a href="https://www.google.com/search?q=coronavirus">
                <p className="text-center mt-4 font-medium text-blue-800">
                  See Information
                </p>
              </a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
